[{"location":"","page":"Home","title":"Home","text":"CurrentModule = IntegratedWienerProcesses","category":"page"},{"location":"#IntegratedWienerProcesses","page":"Home","title":"IntegratedWienerProcesses","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for IntegratedWienerProcesses.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [IntegratedWienerProcesses]","category":"page"},{"location":"#IntegratedWienerProcesses.IWP-Union{Tuple{IWP{T, N}}, Tuple{N}, Tuple{T}, Tuple{U}} where {U, T, N}","page":"Home","title":"IntegratedWienerProcesses.IWP","text":"IWP{U}(M::IWP{T,N})\n\nComputes an IWP of element type U from the IWP M of element type T\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses._iwp_ssparams_reverse_1d-Union{Tuple{T}, Tuple{Type{T}, Integer}} where T<:Number","page":"Home","title":"IntegratedWienerProcesses._iwp_ssparams_reverse_1d","text":"_iwp_ssparams_reverse_1d(::Type{T}, ndiff::Integer)\n\nComputes the matrices A, B, and C associated with the state-space realization of a one dimensiona IWP, where the state vector x is ordered from highest Taylor coefficient to the lowest.\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses._rgram_cholf_reverse_1d-Union{Tuple{T}, Tuple{Integer, T}} where T<:Real","page":"Home","title":"IntegratedWienerProcesses._rgram_cholf_reverse_1d","text":"_rgram_cholf_reverse_1d(ndiff::Integer, dt::T)\n\nComputes the lower triangular Cholesky factor reachability Grammian of ndiff-fold integrator over the interval [0, dt]. This is the same as the IWP process noise for a transtion over [t, t+dt].\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses._transition_matrix_1d-Union{Tuple{T}, Tuple{Integer, T}} where T<:Real","page":"Home","title":"IntegratedWienerProcesses._transition_matrix_1d","text":"_transition_matrix_1d(ndiff::Integer, dt::T)\n\nComputes the transition matrix A of an ndiff-fold integrator over the interval [0, dt].\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses.dim-Tuple{IWP}","page":"Home","title":"IntegratedWienerProcesses.dim","text":"dim(M::IWP)\n\nComputes the number of dimensions of M.\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses.ndiff-Tuple{IWP}","page":"Home","title":"IntegratedWienerProcesses.ndiff","text":"ndiff(M::IWP)\n\nComputes the number of times M is differentiable.\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses.ssparams_reverse-Union{Tuple{IWP{T}}, Tuple{T}} where T","page":"Home","title":"IntegratedWienerProcesses.ssparams_reverse","text":"ssparams_reverse(M::IWP{T})\n\nComputes the matrices A, B, and C associated with the state-space realization of M\n\ndx = Axdt + Bdw y = Cx\n\nwhere the state vector x is ordered from highest Taylor coefficient to the lowest.\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses.state2diff_matrix_reverse-Union{Tuple{T}, Tuple{IWP{T}, Integer}} where T","page":"Home","title":"IntegratedWienerProcesses.state2diff_matrix_reverse","text":"state2diff_matrix_reverse(M::IWP{T}, m::Integer)\n\nComputes the matrix Cm such that\n\nD^m y = Cm*x,\n\nwhere x is the state vector of the reverse ordered state-space realization.\n\n\n\n\n\n","category":"method"},{"location":"#IntegratedWienerProcesses.transition_parameters_cholf_reverse-Union{Tuple{T}, Tuple{IWP{T}, T}} where T<:Real","page":"Home","title":"IntegratedWienerProcesses.transition_parameters_cholf_reverse","text":"transition_parameters_cholf_reverse(M::IWP{T}, dt::T)\n\nComputes the transition parameters A, L of the IWP M for the interval dt. Here  L is the lower triangular Cholesky factor of the process noise,\n\n\n\n\n\n","category":"method"}]
